(this["webpackJsonprunelite.net"]=this["webpackJsonprunelite.net"]||[]).push([[107],{385:function(e,n){e.exports={title:"1.5.34 Release",description:"Bank value searching and volume overrides",author:"Jordan",body:'<p>The <a href="https://github.com/runelite/runelite/wiki/Bank" native="" rel="nofollow">Bank plugin</a> now supports searching for items\nby value. Thanks to <a href="https://github.com/raiyni" native="" rel="nofollow">@raiyni</a> for this feature.</p>\n<p><img src="/img/blog/1.5.34-Release/bank-value-search.gif" alt="Bank value search"></p>\n<p>The <a href="https://github.com/runelite/runelite/wiki/Music" native="" rel="nofollow">Music plugin</a> now offers volume overrides for\nthe ingame music, sound effect, and area sound effect volumes. These settings allow you to set more\ngranular values for each of these volumes.</p>\n<p>There are also several smaller improvements and bug fixes, including:</p>\n<ul>\n<li>The <a href="https://github.com/runelite/runelite/wiki/Opponent-Information" native="" rel="nofollow">Opponent Information plugin</a>\nnow has an option to highlight the Attack option for NPCs you are attacking or are attacking you</li>\n<li>Forthos Dungeon monsters now show proper HP values in the <a href="https://github.com/runelite/runelite/wiki/Opponent-Information" native="" rel="nofollow">Opponent Information\nplugin</a> and will now cause the\n<a href="https://github.com/runelite/runelite/wiki/XP-Tracker" native="" rel="nofollow">XP Tracker plugin</a> to display kills to\ngoal targets instead of actions</li>\n<li>The <a href="https://github.com/runelite/runelite/wiki/Agility" native="" rel="nofollow">Agility plugin</a> now has an option to\ndisplay laps needed to reach your set agility goal</li>\n<li>You can now set the left-click menu option of the house advertisement board using the <a href="https://github.com/runelite/runelite/wiki/Menu-Entry-Swapper" native="" rel="nofollow">Menu Entry\nSwapper plugin</a></li>\n<li>The <a href="https://github.com/runelite/runelite/wiki/Timers" native="" rel="nofollow">Timers plugin</a> no longer thinks the\n&quot;Protect from Magic&quot; prayer halves the duration of normal spellbook freeze spells</li>\n<li>The <a href="https://github.com/runelite/runelite/wiki/Loot-Tracker" native="" rel="nofollow">Loot Tracker plugin</a> now truncates\nmonster names instead of kill count for entries with long text</li>\n</ul>\n<p>Enjoy!</p>\n<p>- Jordan</p>\n<h3>New commits</h3>\n<p>We had 12 contributors this release!</p>\n<pre><code>Adam (8):\n      menu entry swapper: fix menu searching optimization\n      bank tags: use item name string indexof from script\n      opponent info: add show opponents in menu\n      hooks: ignore npc update immediately after login\n      api: add sound volume accessors and vars\n      api: add volume changed event\n      music list plugin: rename to music plugin\n      music plugin: add sound volume overrides\n\nBrian Rogers (1):\n      item mappings: update birds nest mapping\n\nDaniel Bolink (1):\n      Remove Half timers for Snare, Bind and Entangle\n\nHudson Shykowski (1):\n      Add Forthos Dungeon monsters to the NPC health list\n\nHydrox6 (2):\n      loot tracker: truncate name instead of kills\n      clues: fix emote hint ordering\n\nJohn Polich (2):\n      clues: update &quot;Salty peter&quot; solution for Hosidius rework\n      clues: add fairy ring code to &quot;Graveyard west of Shayzien&quot; solution\n\nJordan Atwood (1):\n      cluescrolls: Reset clue on new beginner/master step\n\nKrysa (2):\n      clues: update Warriors\' Guild emote clue\n      clues: add Deviant spectre variant to cryptic clue\n\nMax Weber (3):\n      runelite-api: Add setAllWidgetsAreOpTargetable\n      runelite-client: Don\'t add our menu options in spell casting/target mode\n      WidgetInspector: Add widget picker\n\nRon Young (1):\n      bank plugin: add item value searching\n\nbeaumitch (1):\n      agility plugin: add laps to goal to overlay\n\neric-weaver (1):\n      menu entry swapper: add house advertisement board\n</code></pre>\n',image:"/img/blog/1.5.34-Release/bank-value-search.gif"}}}]);
